    LLVMBOLT            = /usr/bin/time -v $[BOLT_BIN_PATH]/llvm-bolt
    MERGE_BOLT_PROF     = $[BOLT_BIN_PATH]/merge-fdata

    CC                  = $(LLVM_BIN_PATH)/clang %{model}
    CXX                 = $(LLVM_BIN_PATH)/clang++ %{model}
    FORTRAN_COMP        = $(LLVM_BIN_PATH)/clang %{model}
    FC                  = $(FORTRAN_COMP) %{model}
    CLD                 = /usr/bin/time -v $(LLVM_BIN_PATH)/clang %{model}
    CXXLD               = /usr/bin/time -v $(LLVM_BIN_PATH)/clang++ %{model}
    FLD                 = $(LLVM_BIN_PATH)/clang %{model}
