    #-Wl,--rpath=/usr/crosstool/v18/x86_64-grtev4-linux-gnu/lib64 \
    PORTABILITY        = -DSPEC_CPU_LP64
    #-L$(gperftools) -ltcmalloc \

merge_pgo_profiles= $[LLVM_BIN_PATH]/llvm-profdata merge --output=${PGO_PROFILE} ${PGO_PROF_DIR}/*.profraw
clean_pgo_profiles = rm -rf ${PGO_PROF_DIR} ; mkdir -p ${PGO_PROF_DIR}

clean_perf_profiles = rm -rf ${PERF_PROF_DIR}; mkdir -p ${PERF_PROF_DIR}
clean_lto_cache = rm -rf lto.cache
create_propeller_profile = ${CREATE_LLVM_PROF_PATH} --format=propeller --propeller_symorder=${PROPELLER_SYMORDER} --out=${PROPELLER_PROFILE} --profile="`ls -1 ${PERF_PROF_DIR}/perf.data.* | paste -sd ';' -`" --binary=${baseexe} --alsologtostderr
create_bolt_profile = find ${PERF_PROF_DIR} -type f -name perf.data.* -exec bash -c '${PERF2BOLT} -p {} -o "\${0/.data/.fdata}" ${baseexe}' {} \\; ; echo "BOLT_MERGE" ; ${MERGE_BOLT_PROF} `ls -1 ${PERF_PROF_DIR}/perf.fdata.* | paste -sd ' ' -` > ${BOLT_PROFILE} ; echo "BOLT_MERGE_DONE"
optimize_with_bolt = ${LLVMBOLT} ${baseexe} -data=${BOLT_PROFILE} -o /tmp/${baseexe}.bolted -reorder-blocks=cache+ -reorder-functions=hfsort+ -split-functions=3 -split-all-cold -split-eh

