default=base:
    FOPTIMIZE     = -funroll-loops
    #EXTRA_FFLAGS  = -fplugin=$(DRAGONEGG_PATH)/dragonegg.so
    EXTRA_FLIBS   = -lgfortran -lm
intrate,fprate:
    preENV_LIBRARY_PATH     = $[LLVM_LIB_PATH]
    preENV_LD_LIBRARY_PATH  = $[LLVM_LIB_PATH]

%if %{runpmu} == 1
    monitor_pre_bench  = mkdir -p $[PMU_DIR]/${tune}_${label} ; rm -f /tmp/spec_perf.csv ; rm -f $[PMU_DIR]/${tune}_${label}/*.csv
    monitor_wrapper    = perf stat -e cycles,instructions,br_inst_retired.all_branches,br_misp_retired.all_branches,br_inst_retired.conditional,br_inst_retired.near_taken,br_inst_retired.not_taken,icache_64b.iftag_hit,icache_64b.iftag_miss,idq.dsb_uops,lsd.uops,idq.mite_uops,idq.ms_uops,itlb_misses.miss_causes_a_walk,itlb_misses.stlb_hit,L1-dcache-load-misses,page-faults,LLC-load-misses,l2_rqsts.code_rd_miss,l2_rqsts.all_demand_miss --append --field-separator=\\\$ -o /tmp/spec_perf.csv -- ${command}
    monitor_post_bench = mv /tmp/spec_perf.csv $[PMU_DIR]/${tune}_${label}/${iter}.csv
%endif

%if %{runtopdown} == 1
    monitor_pre_bench  = mkdir -p $[TOPDOWN_DIR]/${tune}_${label} ; taskset -c 40 perf stat --topdown -a -I 5000 --field-separator=\\\$ &> $[TOPDOWN_DIR]/${tune}_${label}/topdown.csv &
    monitor_post_bench = killall perf_4.19
%endif



