       preENV_GOMP_CPU_AFFINITY = 0-%{cputhreads}
%endif

#--------  Peak Tuning Flags ----------------------------------------------
default=peak:
    FOPTIMIZE      = -funroll-loops
    EXTRA_FLIBS    = -lgfortran -lm
    #fdo_pre_make1  = ${clean_lto_cache}
    PASS1_OPTIMIZE =  ${PGINSTRUMENT}
    #fdo_pre_make2  = ${clean_lto_cache}
    PASS2_OPTIMIZE =  ${PGOPTIMIZE}
    #PASS3_OPTIMIZE =  ${PGOPTIMIZE}
%if %{reprofile} == 1
    fdo_pre0 = ${clean_pgo_profiles}
    fdo_post1 = ${merge_pgo_profiles}
%else
    fdo_run1 = echo "(export LLVM_PROFILE_FILE=/tmp && $command)" > run.sh ; bash run.sh
%endif
    #EXTRA_FFLAGS  = -fplugin=$(DRAGONEGG_PATH)/dragonegg.so

default=peak=propeller:
    PASS2_OPTIMIZE +=  -fbasic-block-sections=labels
	PASS2_LDFLAGS  +=  -Wl,--lto-basic-block-sections=labels
%if %{reprofile} == 1
    fdo_pre2 = ${clean_perf_profiles}
    fdo_run2      = perf record -e cycles:u -j any,u --timestamp-filename  -- ${command}; mv perf.data.* ${PERF_PROF_DIR}
%endif
    fdo_post2   = ${create_propeller_profile}
    #fdo_pre_make3  = ${clean_lto_cache}
    PASS3_OPTIMIZE  = ${PGOPTIMIZE} -fbasic-block-sections=list=${PROPELLER_PROFILE}
    PASS3_LDFLAGS = -Wl,--lto-basic-block-sections=${PROPELLER_PROFILE} -Wl,-symbol-ordering-file=${PROPELLER_SYMORDER}
    #PASS4_OPTIMIZE  = ${PGOPTIMIZE} -fpropeller-optimize=${PROPELLER_PROFILE}
    #PASS4_LDFLAGS = -Wl,-symbol-ordering-file=${PROPELLER_SYMORDER}

default=peak=bolt:
    #fdo_pre_make2  = ${clean_lto_cache}
    PASS2_LDFLAGS  += -Wl,-q
%if %{reprofile} == 1
    fdo_pre2 = ${clean_perf_profiles}
    fdo_run2      = perf record -e cycles:u -j any,u --timestamp-filename  -- ${command}; mv perf.data.* ${PERF_PROF_DIR}
%endif
    fdo_post2   = ${create_bolt_profile}
    fdo_pre_make3  = ${optimize_with_bolt}
